ght: none; border-bottom: none; border-left: none; border-image: initial; background: 0px 0px rgb(249, 249, 249); vertical-align: top; float: none !important;\\\">$ 8.45</td></tr><tr class=\\\"row-6 even\\\"><td class=\\\"column-1\\\" style=\\\"padding: 8px; border-top: 1px solid rgb(221, 221, 221); border-right: none; border-bottom: none; border-left: none; border-image: initial; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: top; float: none !important;\\\">Medium Flat Rate Box</td><td class=\\\"column-3\\\" style=\\\"padding: 8px; border-top: 1px solid rgb(221, 221, 221); border-right: none; border-bottom: none; border-left: none; border-image: initial; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: top; float: none !important;\\\">$ 15.50</td></tr><tr class=\\\"row-7 odd\\\"><td class=\\\"column-1\\\" style=\\\"padding: 8px; border-top: 1px solid rgb(221, 221, 221); border-right: none; border-bottom: none; border-left: none; border-image: initial; background: 0px 0px rgb(249, 249, 249); vertical-align: top; float: none !important;\\\">Large Flat Rate Box</td><td class=\\\"column-3\\\" style=\\\"padding: 8px; border-top: 1px solid rgb(221, 221, 221); border-right: none; border-bottom: none; border-left: none; border-image: initial; background: 0px 0px rgb(249, 249, 249); vertical-align: top; float: none !important;\\\">$ 21.90</td></tr><tr class=\\\"row-8 even\\\"><td class=\\\"column-1\\\" style=\\\"padding: 8px; border-top: 1px solid rgb(221, 221, 221); border-right: none; border-bottom: none; border-left: none; border-image: initial; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: top; float: none !important;\\\">APO/FPO/DPO Large Flat Rate Box</td><td class=\\\"column-3\\\" style=\\\"padding: 8px; border-top: 1px solid rgb(221, 221, 221); border-right: none; border-bottom: none; border-left: none; border-image: initial; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: top; float: none !important;\\\">$ 20.40</td></tr><tr class=\\\"row-9 odd\\\"><td class=\\\"column-1\\\" style=\\\"padding: 8px; border-top: 1px solid rgb(221, 221, 221); border-right: none; border-bottom: none; border-left: none; border-image: initial; background: 0px 0px rgb(249, 249, 249); vertical-align: top; float: none !important;\\\">*must use boxes</td><td class=\\\"column-3\\\" style=\\\"padding: 8px; border-top: 1px solid rgb(221, 221, 221); border-right: none; border-bottom: none; border-left: none; border-image: initial; background: 0px 0px rgb(249, 249, 249); vertical-align: top; float: none !important;\\\"></td></tr></tbody></table><p style=\\\"color: rgb(119, 119, 119); font-family: LatoLatinWeb, sans-serif; font-size: 18px;\\\">Now letâ€™s cover the various types of packaging you can choose.</p><p style=\\\"color: rgb(119, 119, 119); font-family: LatoLatinWeb, sans-serif; font-size: 18px;\\\"></p><h2 style=\\\"font-family: LatoLatinWeb, sans-serif; font-weight: bold; color: rgb(0, 0, 0); margin: 40px 0px 24px; font-size: 28px;\\\">eBay Brown (First Class or Priority Mail)</h2><ul><li style=\\\"font-family: LatoLatinWeb, sans-serif; font-weight: bold; color: rgb(0, 0, 0); margin: 40px 0px 24px; font-size: 28px;\\\">6x4x4 &amp; 12x6x6<br></li></ul><h2 style=\\\"font-family: LatoLatinWeb, sans-serif; font-weight: bold; color: rgb(0, 0, 0); margin: 40px 0px 24px; font-size: 28px;\\\"><p style=\\\"font-weight: 400; color: rgb(119, 119, 119); font-size: 18px;\\\"></p><p style=\\\"font-weight: 400; color: rgb(119, 119, 119); font-size: 18px;\\\">Perhaps the only downside is that you have to use USPS-branded boxes to take advantage of this shipping method. You cannot use USPS Flat Rate shipping in a plain brown box or your own branded packaging. As long as that is not crucial to your businessâ€™s branding strategy, these free boxes are woth keeping in mind. The contents of the package must also fit comfortably inside without any bulging.</p></h2><h2 style=\\\"font-family: LatoLatinWeb, sans-serif; font-weight: bold; color: rgb(0, 0, 0); margin: 40px 0px 24px; font-size: 28px;\\\">What are USPS Priority Mail Flat Rate Boxes?</h2><p style=\\\"color: rgb(119, 119, 119); font-family: LatoLatinWeb, sans-serif; font-size: 18px;\\\"></p><p style=\\\"color: rgb(119, 119, 119); font-family: LatoLatinWeb, sans-serif; font-size: 18px;\\\">Perhaps the only downside is that you have to use USPS-branded boxes to take advantage of this shipping method. You cannot use USPS Flat Rate shipping in a plain brown box or your own branded packaging. As long as that is not crucial to your businessâ€™s branding strategy, these free boxes are worth keeping in mind. The contents of the package must also fit comfortably inside without any bulging.</p><p style=\\\"text-align: center; color: rgb(119, 119, 119); font-family: LatoLatinWeb, sans-serif; font-size: 18px;\\\"><img style=\\\"width: 370px;\\\" src=\\\"data:image/png;base64,\\\" data-filename=\\\"Flat-Rate-Box.png\\\"><br></p><p style=\\\"color: rgb(119, 119, 119); font-family: LatoLatinWeb, sans-serif; font-size: 18px;\\\"></p><p style=\\\"color: rgb(119, 119, 119); font-family: LatoLatinWeb, sans-serif; font-size: 18px;\\\">As the weight of your package or distance traveled increases, the benefit of using the various USPS Flat Rate boxes also increases. Letâ€™s dive into what USPS Flat Rate packaging is available to use and how each of them can benefit your business.</p><p style=\\\"color: rgb(119, 119, 119); font-family: LatoLatinWeb, sans-serif; font-size: 18px;\\\"></p><h3 style=\\\"font-family: LatoLatinWeb, sans-serif; color: rgb(119, 119, 119);\\\">USPS Priority Mail Flat Rate Envelopes</h3><p style=\\\"color: rgb(119, 119, 119); font-family: LatoLatinWeb, sans-serif; font-size: 18px;\\\"></p><p style=\\\"color: rgb(119, 119, 119); font-family: LatoLatinWeb, sans-serif; font-size: 18px;\\\">There are three types of envelopes available in USPS Flat Rate shipping. Some offer a bit more protection than others. The three types are:</p><ul style=\\\"color: rgb(119, 119, 119); font-family: LatoLatinWeb, sans-serif; font-size: 18px;\\\"><li>Priority Mail Flat Rate Envelope: 12 Â½â€ (L) x 9 Â½â€ (W)</li><li>Priority Mail Flat Rate Legal Envelope: 15â€ (L) x 9 Â½â€ (W)</li><li>Priority Mail Flat Rate Padded Envelope 9 Â½â€ (L) x 12 Â½â€ (W)</li></ul><p style=\\\"text-align: center; color: rgb(119, 119, 119); font-family: LatoLatinWeb, sans-serif; font-size: 18px;\\\"><img style=\\\"width: 600px;\\\" src=\\\"data:image/jpeg;base64,\\\" data-filename=\\\"USPS-Flat-Rate-Padded-Envelope.jpg\\\"><br></p><p style=\\\"color: rgb(119, 119, 119); font-family: LatoLatinWeb, sans-serif; font-size: 18px;\\\">All of the above are available with the Priority Mail Flat Rate Express option as well. These envelopes are perfect for documents, tickets, art, jewelry, and other non-bulky items. Aside from a few instances of very nearby Zones, these envelopes will likely save you over weight-based Priority Mail shipping options.</p><p style=\\\"color: rgb(119, 119, 119); font-family: LatoLatinWeb, sans-serif; font-size: 18px;\\\"></p><h3 style=\\\"font-family: LatoLatinWeb, sans-serif; color: rgb(119, 119, 119);\\\">USPS Priority Mail Flat Rate Small Box</h3><p style=\\\"color: rgb(119, 119, 119); font-family: LatoLatinWeb, sans-serif; font-size: 18px;\\\"></p><p style=\\\"color: rgb(119, 119, 119); font-family: LatoLatinWeb, sans-serif; font-size: 18px;\\\">For smaller items, particularly small dense/heavy items, that wonâ€™t fit in an envelope, USPS Priority Mail Flat Rate Small Box is a great option. Below are the dimensions for a Flat Rate Small Box.</p><ul style=\\\"color: rgb(119, 119, 119); font-family: LatoLatinWeb, sans-serif; font-size: 18px;\\\"><li><span style=\\\"font-weight: 700;\\\">Outside</span>: 8 11/16â€³ x 5 7/16â€³ x 1 3/4â€³</li><li><span style=\\\"font-weight: 700;\\\">Inside</span>: 8 5/8â€³ x 5 3/8â€³ x 1 5/8â€³</li></ul><p style=\\\"text-align: center; color: rgb(119, 119, 119); font-family: LatoLatinWeb, sans-serif; font-size: 18px;\\\"><img style=\\\"width: 600px;\\\" src=\\\"data:image/jpeg;base64,\\\" data-filename=\\\"USPS-Flat-Rate-Small-Box.jpg\\\"><br></p><p style=\\\"color: rgb(119, 119, 119); font-family: LatoLatinWeb, sans-serif; font-size: 18px;\\\">USPS describes the box size as about the same as three stacked DVD cases, for those of us who remember what DVDs are. The boxes feature self-adhesive flaps, which must be able to close fully based on the folds. This indicates that your contents canâ€™t bulge the flaps and must fit fully inside the box. That will be the rule for all of the boxes we will discuss here.</p><p style=\\\"color: rgb(119, 119, 119); font-family: LatoLatinWeb, sans-serif; font-size: 18px;\\\">This box type is great for bulkier jewelry, vape supplies, small electronics, and more. For example, our customer&nbsp;<a href=\\\"https://shippingeasy.com/furls-crochet-case-study/\\\" rel=\\\"noopener noreferrer\\\" target=\\\"_blank\\\" style=\\\"color: rgb(12, 76, 113);\\\">Furls Crochet uses Flat Rate Small Boxes</a>&nbsp;to ship their custom crochet and knitting needles.</p><p style=\\\"color: rgb(119, 119, 119); font-family: LatoLatinWeb, sans-serif; font-size: 18px;\\\"></p><h3 style=\\\"font-family: LatoLatinWeb, sans-serif; color: rgb(119, 119, 119);\\\">USPS Priority Mail Flat Rate Medium Box</h3><p style=\\\"color: rgb(119, 119, 119); font-family: LatoLatinWeb, sans-serif; font-size: 18px;\\\"></p><p style=\\\"color: rgb(119, 119, 119); font-family: LatoLatinWeb, sans-serif; font-size: 18px;\\\">One major departure from the Small Boxes to the USPS Flat Rate Medium Boxes is that there are two versions. Medium Boxes come in a side-loading version, which is a bit more narrow, and a top-loading version, which offers a bit more inside space. These two versions can be helpful in better accommodating varying sized products.</p><p style=\\\"color: rgb(119, 119, 119); font-family: LatoLatinWeb, sans-serif; font-size: 18px;\\\"><span style=\\\"font-weight: 700;\\\">USPS Flat Rate Medium Box-1 Specs (top-loading)</span>:</p><ul style=\\\"color: rgb(119, 119, 119); font-family: LatoLatinWeb, sans-serif; font-size: 18px;\\\"><li><span style=\\\"font-weight: 700;\\\">Outside</span>: 11 1/4â€³ x 8 3/4â€³ x 6â€³</li><li><span style=\\\"font-weight: 700;\\\">Inside</span>: 11â€³ x 8 1/2â€³ x 5 1/2â€³</li></ul><p style=\\\"color: rgb(119, 119, 119); font-family: LatoLatinWeb, sans-serif; font-size: 18px;\\\"><span style=\\\"font-weight: 700;\\\">USPS Flat Rate Medium Box-2 Specs (side-loading)</span>:</p><ul style=\\\"color: rgb(119, 119, 119); font-family: LatoLatinWeb, sans-serif; font-size: 18px;\\\"><li><span style=\\\"font-weight: 700;\\\">Outside</span>: 14â€³ x 12â€³ x 3 1/2â€³</li><li><span style=\\\"font-weight: 700;\\\">Inside</span>: 13 5/8â€³ x 11 7/8â€³ x 3 3/8â€³</li></ul><p style=\\\"color: rgb(119, 119, 119); font-family: LatoLatinWeb, sans-serif; font-size: 18px;\\\">You can see the differences between the two below.</p><p style=\\\"text-align: center; color: rgb(119, 119, 119); font-family: LatoLatinWeb, sans-serif; font-size: 18px;\\\"><img style=\\\"width: 800px;\\\" src=\\\"data:image/png;base64,\\\" data-filename=\\\"USPS-Flat-Rate-Medium-Box-Sizes-1-and-2.png\\\"><br></p><p style=\\\"color: rgb(119, 119, 119); font-family: LatoLatinWeb, sans-serif; font-size: 18px;\\\"></p><p style=\\\"color: rgb(119, 119, 119); font-family: LatoLatinWeb, sans-serif; font-size: 18px;\\\">As you can see, the types of products that would easily fit in these two boxes varies wildly, but they cost the same amount to ship. Box 1 could be used to ship shoes. Box 2 is what we use when we ship dozens of printed versions of our&nbsp;<font color=\\\"#0c4c71\\\">E-commerce Sellerâ€™s Guide to Shipping Rate Changes</font>&nbsp;to our partners, for example.</p><p style=\\\"color: rgb(119, 119, 119); font-family: LatoLatinWeb, sans-serif; font-size: 18px;\\\">Also, once you reach this box size, itâ€™s more crucial to compare the cost versus weight-based shipping. There are many instances where the latter would still be cheaper than flat-rate shipping depending on weight and destination.</p><p style=\\\"color: rgb(119, 119, 119); font-family: LatoLatinWeb, sans-serif; font-size: 18px;\\\"></p><h3 style=\\\"font-family: LatoLatinWeb, sans-serif; color: rgb(119, 119, 119);\\\">USPS Priority Mail Flat Rate Large Box</h3><p style=\\\"color: rgb(119, 119, 119); font-family: LatoLatinWeb, sans-serif; font-size: 18px;\\\"></p><p style=\\\"color: rgb(119, 119, 119); font-family: LatoLatinWeb, sans-serif; font-size: 18px;\\\">The USPS Flat Rate Large Box really offers value once youâ€™re shipping larger, heavier packages. Youâ€™ll find this method cheaper than weight-based options for packages weighing more than 25 pounds to most Zones. Packages traveling further across the country will likely be cheaper using USPS Flat Rate Large Boxes depending on the weight.</p><p style=\\\"color: rgb(119, 119, 119); font-family: LatoLatinWeb, sans-serif; font-size: 18px;\\\">For scale, these boxes could be used to ship larger electronics like computers and laptops.</p><ul style=\\\"color: rgb(119, 119, 119); font-family: LatoLatinWeb, sans-serif; font-size: 18px;\\\"><li><span style=\\\"font-weight: 700;\\\">Outside</span>: 12 1/4â€³ x 12 1/4â€³ x 6â€³</li><li><span style=\\\"font-weight: 700;\\\">Inside</span>: 12â€³ x 12â€³ x 5 1/2â€³</li></ul><p style=\\\"text-align: center; color: rgb(119, 119, 119); font-family: LatoLatinWeb, sans-serif; font-size: 18px;\\\"><img style=\\\"width: 600px;\\\" src=\\\"data:image/jpeg;base64,\\\" data-filename=\\\"USPS-Flat-Rate-Shipping-Large-Box.jpg\\\"><br></p><p style=\\\"color: rgb(119, 119, 119); font-family: LatoLatinWeb, sans-serif; font-size: 18px;\\\">A benefit of using a technology like ShippingEasy is that you can set rules for assigning shipping selections. If you have larger items that travel varying distances, you can set rules to select either USPS Flat Rate Large Box or USPS Priority Mail to automate making the better decision based on weight and distance traveled!</p><p style=\\\"color: rgb(119, 119, 119); font-family: LatoLatinWeb, sans-serif; font-size: 18px;\\\"></p><h3 style=\\\"font-family: LatoLatinWeb, sans-serif; color: rgb(119, 119, 119);\\\">USPS Priority Mail APO/FPO/DPO Large Flat Rate Box</h3><p style=\\\"color: rgb(119, 119, 119); font-family: LatoLatinWeb, sans-serif; font-size: 18px;\\\"></p><p style=\\\"color: rgb(119, 119, 119); font-family: LatoLatinWeb, sans-serif; font-size: 18px;\\\">This package type is specifically used for sending items to troops and military personnel stationed overseas. It has the same dimensions as the USPS Flat Rate Large Box but includes a message of support for the troops and offers a discounted rate.</p><ul style=\\\"color: rgb(119, 119, 119); font-family: LatoLatinWeb, sans-serif; font-size: 18px;\\\"><li><span style=\\\"font-weight: 700;\\\">Outside</span>: 12 1/4â€³ x 12 1/4â€³ x 6â€³</li><li><span style=\\\"font-weight: 700;\\\">Inside</span>: 12â€³ x 12â€³ x 5 1/2â€³</li></ul><p style=\\\"text-align: center; color: rgb(119, 119, 119); font-family: LatoLatinWeb, sans-serif; font-size: 18px;\\\"><img style=\\\"width: 600px;\\\" src=\\\"data:image/jpeg;base64,\\\" data-filename=\\\"USPS-Flat-Rate-Shipping-APO-FPO-box.jpg\\\"><br></p><p style=\\\"color: rgb(119, 119, 119); font-family: LatoLatinWeb, sans-serif; font-size: 18px;\\\">The size of the package supports the ability to fill it with approved items with the same weight limit of 70 pounds. Shipping overseas can be a bit pricey, so this flat-rate shipping option makes it much easier to send items to loved ones.</p><p style=\\\"color: rgb(119, 119, 119); font-family: LatoLatinWeb, sans-serif; font-size: 18px;\\\"></p><h2 style=\\\"font-family: LatoLatinWeb, sans-serif; font-weight: bold; color: rgb(0, 0, 0); margin: 40px 0px 24px; font-size: 28px;\\\">What is USPS Regional Rate shipping?</h2><h2 style=\\\"font-family: LatoLatinWeb, sans-serif; font-weight: bold; color: rgb(0, 0, 0); margin: 40px 0px 24px; font-size: 28px;\\\"><p style=\\\"font-weight: 400; color: rgb(119, 119, 119); font-size: 18px;\\\"></p><p style=\\\"font-weight: 400; color: rgb(119, 119, 119); font-size: 18px;\\\">USPS Regional Rate is a shipping method that provides a flat rate up to 15 or 20 pounds depending on which of the two box options you use. The difference between this and USPS Priority Mail Flat Rate is that it still takes distance traveled into account.</p><p style=\\\"font-weight: 400; color: rgb(119, 119, 119); font-size: 18px;\\\">If you compare Regional Rate to both standard Priority Mail weight-based methods and other Priority Mail Flat Rate options, there are times when it will win out and when it will not. The savings can be substantial when it does win out, so itâ€™s worth making the comparisons.</p><p style=\\\"font-weight: 400; color: rgb(119, 119, 119); font-size: 18px;\\\">For example, if you compare Regional Rate Box A versus Medium &amp; Large Flat Rate Boxes, Box A wins out for almost every Zone (up to 15 pounds, as that is the limit for Regional Rate Box A).</p><p style=\\\"font-weight: 400; color: rgb(119, 119, 119); font-size: 18px;\\\">When comparing Regional Rate Box B versus Medium &amp; Large Flat Rate Boxes up to 20 pounds, Regional Rate Box B wins from Zones 1-5, but 6-7 Medium Flat Rate wins, and for Zones 8-9 Large Flat Rate wins.</p><p style=\\\"font-weight: 400; color: rgb(119, 119, 119); font-size: 18px;\\\">Much like USPS Priority Mail Medium Flat Rate Boxes, there are two different versions of Regional Rate Boxes for both A and B sizes.</p><p style=\\\"font-weight: 400; color: rgb(119, 119, 119); font-size: 18px;\\\"></p></h2><h3 style=\\\"font-family: LatoLatinWeb, sans-serif; color: rgb(119, 119, 119);\\\">USPS Priority Mail Regional Rate Box A1 and A2</h3><h2 style=\\\"font-family: LatoLatinWeb, sans-serif; font-weight: bold; color: rgb(0, 0, 0); margin: 40px 0px 24px; font-size: 28px;\\\"><p style=\\\"font-weight: 400; color: rgb(119, 119, 119); font-size: 18px;\\\"></p><p style=\\\"font-weight: 400; color: rgb(119, 119, 119); font-size: 18px;\\\"><img src=\\\"data:image/png;base64,\\\" data-filename=\\\"USPS-Priority-Mail-Regional-Rate-Box-A.png\\\" style=\\\"width: 800px;\\\"><br></p><p style=\\\"font-weight: 400; color: rgb(119, 119, 119); font-size: 18px;\\\"><span style=\\\"font-weight: 700;\\\">USPS Priority Mail Regional Rate A1 specs</span>:</p><ul style=\\\"font-weight: 400; color: rgb(119, 119, 119); font-size: 18px;\\\">Outside: 10 â…›â€ (L) x 7 â…›â€ (W) x 5â€ (H)<br>Inside: 10â€ (L) x 7â€ (W) x 4 Â¾â€ (H)</ul><p style=\\\"font-weight: 400; color: rgb(119, 119, 119); font-size: 18px;\\\"><span style=\\\"font-weight: 700;\\\">USPS Priority Mail Regional Rate A2 specs</span>:</p><ul style=\\\"font-weight: 400; color: rgb(119, 119, 119); font-size: 18px;\\\">Outside: 11 1/16â€ (L) x 2 Â½â€ (W) x 13 1/16â€ (H)<br>Inside: 12 15/16â€ (L) x 2 â…œâ€ (W) x 12 13/16â€ (H)</ul><p style=\\\"font-weight: 400; color: rgb(119, 119, 119); font-size: 18px;\\\"></p></h2><h3 style=\\\"font-family: LatoLatinWeb, sans-serif; color: rgb(119, 119, 119);\\\">USPS Priority Mail Regional Rate Box B1 and B2</h3><h2 style=\\\"font-family: LatoLatinWeb, sans-serif; font-weight: bold; color: rgb(0, 0, 0); margin: 40px 0px 24px; font-size: 28px;\\\"><p style=\\\"font-weight: 400; color: rgb(119, 119, 119); font-size: 18px;\\\"></p><p style=\\\"font-weight: 400; text-align: center; color: rgb(119, 119, 119); font-size: 18px;\\\"><img src=\\\"data:image/png;base64,\\\" data-filename=\\\"USPS-Priority-Mail-Regional-Rate-Box-B.png\\\" style=\\\"width: 800px;\\\"><br></p><p style=\\\"font-weight: 400; color: rgb(119, 119, 119); font-size: 18px;\\\"><span style=\\\"font-weight: 700;\\\">USPS Priority Mail Regional Rate B1 specs</span>:</p><ul style=\\\"font-weight: 400; color: rgb(119, 119, 119); font-size: 18px;\\\"><li>Outside: 12 Â¼â€ (L) x 10 Â½â€ (W) x 5 Â½â€ (H)</li><li>Inside: 12 â…›â€ (L) x 10 â…œâ€ (W) x 5 Â¼â€ (H)</li></ul><p style=\\\"font-weight: 400; color: rgb(119, 119, 119); font-size: 18px;\\\"><span style=\\\"font-weight: 700;\\\">USPS Priority Mail Regional Rate B2 specs</span>:</p><ul style=\\\"font-weight: 400; color: rgb(119, 119, 119); font-size: 18px;\\\"><li><span style=\\\"font-weight: 700;\\\">Outside</span>: 14 Â½â€ (L) x 3â€ (W) x 16 Â¼â€ (H)</li><li><span style=\\\"font-weight: 700;\\\">Inside</span>: 14 â…œâ€ (L) x 2 â…žâ€ (W) x 15 â…žâ€ (H</li></ul></h2><p style=\\\"font-family: LatoLatinWeb, sans-serif; color: rgb(119, 119, 119);\\\"><br></p><p style=\\\"color: rgb(119, 119, 119); font-family: LatoLatinWeb, sans-serif; font-size: 18px;\\\"></p><p style=\\\"text-align: center; color: rgb(119, 119, 119); font-family: LatoLatinWeb, sans-serif; font-size: 18px;\\\"></p></div></div></div></div>', '', '', '', '', '', 0);
